  CREATE view [dbo].[getNV] as
  select maNhanVien, tenNhanVien, gioiTinh, soDienThoaiNV, trangThaiLamViec, loaiNV,
  cmnd, tinhTP, quanHuyen, phuongXa from NhanVien n join DiaChi d on n.maDC = d.maDC
  where loaiNV = 0


