create view [dbo].[HoaDon_View] as 
	SELECT NhanVien.maNhanVien, NhanVien.tenNhanVien, NhanVien.soDienThoaiNV, KhachHang.maKhachHang, KhachHang.tenKhachHang, KhachHang.soDienThoai, HoaDonBan.maHoaDonBan, HoaDonBan.ngayLapHDBan, 
					 sum(CT_HoaDonBan.soLuong*(CT_HoaDonBan.giaBan + CT_HoaDonBan.giaBan *CT_HoaDonBan.thueVAT)) as tongTien,tienNhan
	FROM     CT_HoaDonBan INNER JOIN
					  HoaDonBan ON CT_HoaDonBan.maHoaDonBan = HoaDonBan.maHoaDonBan INNER JOIN
					  KhachHang ON HoaDonBan.maKhachHang = KhachHang.maKhachHang INNER JOIN
					  NhanVien ON HoaDonBan.maNhanVien = NhanVien.maNhanVien
	group by NhanVien.maNhanVien, NhanVien.tenNhanVien, NhanVien.soDienThoaiNV, KhachHang.maKhachHang, KhachHang.tenKhachHang, KhachHang.soDienThoai, HoaDonBan.maHoaDonBan, HoaDonBan.ngayLapHDBan,tienNhan


