create trigger capNhatSoLuongThuoc
on [dbo].[CT_HoaDonBan]
for insert as
	declare @a int , @b int
	select @a = Thuoc.soLuongBanDau from Thuoc where maThuoc in (select maThuoc from inserted)
	select @b = soLuong from inserted
	if( @a<@b)
		begin
			print('so Luong Thuoc Khong du')
			rollback
		end
	update Thuoc set soLuongBanDau = soLuongBanDau - (select soLuong from inserted) where maThuoc in  (select maThuoc from inserted)
